import styles from "./app.module.css";
import { data } from "../../utils/data";

function App() {
  return (
    <div className={styles.sqare}>
      <div className={styles.ss}>44</div>
      <div className={styles.ss}>12</div>
      <div className={styles.ss}>55</div>
      <div className={styles.ss}>33</div>

    </div>
  );
}

export default App;
